import jsPDF from 'jspdf';
import { formatCurrency, formatDate } from './formatters';

export interface CarneData {
  creditorId: number;
  creditorName: string;
  customerName: string;
  totalAmount: number;
  installments: number;  
  installmentValue: number;
  dueDate: Date;
  saleId?: number;
  items?: Array<{
    productName: string;
    quantity: number;
    price: number;
  }>;
}

export interface CarneInstallment {
  id?: number;
  creditorId: number;
  installmentNumber: number;
  dueDate: Date;
  amount: number;
  paid: boolean;
  paidAt?: Date;
  createdAt: Date;
}

export class PDFGenerator {

static generateSaleReport(saleData: {
  saleId: number;
  customerName: string;
  customerCPF: string;
  customerAddress: string;
  customerPhone: string;
  items: Array<{ productName: string; quantity: number; price: number; }>;
  total: number;
  discount: number;
  paymentMethod: string;
  installments?: number;
  createdAt: Date;
  deliveryDate: Date;
  seller: string;
}): string {
  const doc = new jsPDF();
  const margin = 10;
  const pageWidth = doc.internal.pageSize.width;

  console.log(saleData)
  // ----- DADOS DA LOJA -----
  const storeInfo = {
    name: 'Boutique Thaina',
    owner: 'Vanderlea Silva Brito',
    address: 'Rua Piripa 352, Bairro Felipe Achy',
    phone: '(77)998732006',
    email: '@Thainaboutique01',
    logoBase64: 'data:image/png;base64,' // coloque seu Base64 aqui
  };

  // Logo à esquerda
  const logoWidth = 40;
  const logoHeight = 40;
  const infoX = margin + logoWidth + 10;
  const infoY = margin;

  doc.addImage(storeInfo.logoBase64, 'JPEG', margin, infoY, logoWidth, logoHeight);

  // Informações da loja
  doc.setFont('helvetica', 'bold');
  doc.setFontSize(12);
  doc.text(storeInfo.name, infoX, infoY + 10);
  doc.setFont('helvetica', 'normal');
  doc.setFontSize(8);
  doc.text(`Proprietário: ${storeInfo.owner}`, infoX, infoY + 18);
  doc.text(`Endereço: ${storeInfo.address}`, infoX, infoY + 26);
  doc.text(`Telefone: ${storeInfo.phone}`, infoX, infoY + 34);
  doc.text(`Instagram: ${storeInfo.email}`, infoX, infoY + 42);

  // ----- QUADRADO 1: RESUMO DO PEDIDO -----
  let currentY = infoY + logoHeight + 15;
  const boxMargin = margin;
  const boxWidth = pageWidth - 2 * boxMargin;
  const boxRadius = 3;

  doc.setFillColor(230, 230, 230);
  doc.roundedRect(boxMargin, currentY, boxWidth, 60, boxRadius, boxRadius, 'S');

  doc.setFont('helvetica', 'bold');
  doc.setFontSize(10);
  doc.text(`Pedido Nº: ${saleData.saleId}`, boxMargin + 5, currentY + 8);
  doc.text(`Vendedor: ${saleData.seller}`, boxMargin + 5, currentY + 15);
  doc.text(`Cliente: ${saleData.customerName}`, boxMargin + 5, currentY + 22);
  doc.text(`Endereço: ${saleData.customerAddress}`, boxMargin + 5, currentY + 29);
  doc.text(`Telefone: ${saleData.customerPhone}`, boxMargin + 5, currentY + 36);
  doc.text(`CPF: ${saleData.customerCPF}`, boxMargin + 90, currentY + 8);
  doc.text(`Data Criação: ${formatDate(saleData.createdAt)}`, boxMargin + 90, currentY + 15);
  doc.text(`Data Entrega: ${formatDate(saleData.deliveryDate)}`, boxMargin + 90, currentY + 22);

  doc.setFont('helvetica', 'normal');
  let paymentText = `Pagamento: ${saleData.paymentMethod}`;
  if (saleData.installments && saleData.installments > 1) {
    paymentText += ` - ${saleData.installments}x (Carnê)`;
  }
  doc.text(paymentText, boxMargin + 5, currentY + 48);

  // ----- QUADRADO 2: ITENS DO PEDIDO -----
  currentY += 65;
  const itemBoxHeight = saleData.items.length * 10 + 15;
  doc.roundedRect(boxMargin, currentY, boxWidth, itemBoxHeight, boxRadius, boxRadius, 'S');

  // Cabeçalho da tabela
  doc.setFillColor(245, 245, 245);
  doc.rect(boxMargin, currentY, boxWidth, 10, 'F');
  doc.setFont('helvetica', 'bold');
  doc.setFontSize(10);
  doc.text('Produto', boxMargin + 5, currentY + 7);
  doc.text('Qtd', boxMargin + 80, currentY + 7);
  doc.text('Valor Unit.', boxMargin + 100, currentY + 7);
  doc.text('Total', boxMargin + 140, currentY + 7);

  doc.setFont('helvetica', 'normal');
  let itemY = currentY + 17;
  saleData.items.forEach(item => {
    doc.text(item.productName, boxMargin + 5, itemY);
    doc.text(item.quantity.toString(), boxMargin + 80, itemY);
    doc.text(formatCurrency(item.price), boxMargin + 100, itemY);
    doc.text(formatCurrency(item.price * item.quantity), boxMargin + 140, itemY);
    doc.setDrawColor(220);
    doc.setLineWidth(0.2);
    doc.line(boxMargin + 5, itemY + 2, boxMargin + boxWidth - 5, itemY + 2);
    itemY += 10;
  });

  // ----- QUADRADO 3: TOTAL -----
  currentY = itemY + 5;
  doc.roundedRect(boxMargin, currentY, boxWidth, 35, boxRadius, boxRadius, 'S');
  doc.setFont('helvetica', 'bold');
  doc.setFontSize(10);
  doc.text(`Preço Total: ${formatCurrency(saleData.total)}`, boxMargin + 5, currentY + 10);
  doc.text(`Desconto: ${formatCurrency(saleData.discount)}`, boxMargin + 5, currentY + 17);

  let totalText = `TOTAL FINAL: ${formatCurrency(saleData.total - saleData.discount)}`;
  if (saleData.installments && saleData.installments > 1) {
    totalText += ` (dividido em ${saleData.installments}x no carnê)`;
  }
  doc.text(totalText, boxMargin + 5, currentY + 24);

  // ----- ASSINATURAS -----
  currentY += 50; // aumento de espaço para assinar
  doc.setFont('helvetica', 'normal');
  doc.text('Assinatura Vendedor: ____________________________', boxMargin + 5, currentY);
  doc.text('Assinatura Cliente: _____________________________', boxMargin + 110, currentY);

  return doc.output('datauristring');
}



static generateCarne(carneData: CarneData): string {
  const doc = new jsPDF();
  const pageHeight = doc.internal.pageSize.height;
  const margin = 10;

  const storeInfo = {
     name: 'Boutique Thaina',
    owner: 'Vanderlea Silva Brito',
    address: 'Rua piripa 352 bairro Felipe achy',
    phone: '(77)998732006',
    instagram: '@Thainaboutique01',
    logoBase64: 'data:image/png;base64,' // coloque seu Base64 aqui
  };

  // Cabeçalho da primeira página
  const logoWidth = 40;
  const logoHeight = 40;
  const infoX = margin + logoWidth + 5;
  const infoY = margin;

  doc.addImage(storeInfo.logoBase64, 'JPEG', margin, infoY, logoWidth, logoHeight);
  doc.setFont('helvetica', 'bold');
  doc.setFontSize(12);
  doc.text(storeInfo.name, infoX, infoY + 10);

  doc.setFont('helvetica', 'normal');
  doc.setFontSize(8);
  doc.text(`Proprietário: ${storeInfo.owner}`, infoX, infoY + 16);
  doc.text(`Endereço: ${storeInfo.address}`, infoX, infoY + 20);
  doc.text(`Telefone: ${storeInfo.phone}`, infoX, infoY + 24);
  doc.text(`Instagram: ${storeInfo.instagram}`, infoX, infoY + 28);

  const lineY = infoY + logoHeight + 5;
  doc.setDrawColor(0);
  doc.setLineWidth(0.5);
  doc.line(margin, lineY, doc.internal.pageSize.width - margin, lineY);

  let currentY = lineY + 5;
  const cardHeight = 50 * 2 + 4; // cada carnê compacto com duas vias
  const totalInstallments = carneData.installments;

  for (let i = 1; i <= totalInstallments; i++) {
    const installmentDueDate = new Date(carneData.dueDate);
    installmentDueDate.setMonth(installmentDueDate.getMonth() + (i - 1));

    // Verifica se cabe na página atual
    if (currentY + cardHeight > pageHeight - margin) {
      doc.addPage();
      currentY = margin;
    }

    const usedHeight = this.drawCarneInstallment(doc, currentY, {
      installmentNumber: i,
      totalInstallments: totalInstallments,
      creditorName: carneData.creditorName,
      customerName: carneData.customerName,
      amount: carneData.installmentValue,
      dueDate: installmentDueDate,
      totalAmount: carneData.totalAmount,
      seller: storeInfo.owner
    });

    currentY += usedHeight + 2; // pequeno espaçamento extra
  }

  return doc.output('datauristring');
}
private static drawCarneInstallment(
  doc: jsPDF,
  y: number,
  data: {
    installmentNumber: number;
    totalInstallments: number;
    creditorName: string;
    customerName: string;
    amount: number;
    dueDate: Date;
    totalAmount: number;
    seller?: string;
  }
): number {
  const x = 20;
  const width = 170;
  const height = 55;    // ainda menor
  const spacing = 5;    // menor espaçamento
  const padding = 6;
  const shop = 'Boutique da Thaina';
  const uniqueId = `PARC-${data.installmentNumber}/${data.totalInstallments}-${Math.random()
    .toString(36)
    .substring(2, 7)
    .toUpperCase()}`;

  const drawVia = (offsetY: number, title: string, assinatura: string) => {
    doc.setDrawColor(0);
    doc.rect(x, offsetY, width, height);

    // Cabeçalho sombreado
    doc.setFillColor(230, 230, 230);
    doc.rect(x, offsetY, width, 10, 'F');
    doc.setFontSize(8);
    doc.setFont('helvetica', 'bold');
    doc.text(`${title} - Parcela ${data.installmentNumber}/${data.totalInstallments}`, x + padding, offsetY + 8);

    doc.setFontSize(6);
    doc.setFont('helvetica', 'normal');
    doc.text(`Vencimento: ${formatDate(data.dueDate)}`, x + width - 45, offsetY + 8);

    // Info estabelecimento e vendedor
    const infoY = offsetY + 12;
    doc.setFontSize(6);
    doc.text(`Estabelecimento: ${shop}`, x + padding, infoY);
    if (data.seller) doc.text(`Vendedor: Thaina`, x + width - 55, infoY);

    // Caixa do cliente
    const clientBoxY = infoY + 4;
    doc.setDrawColor(150);
    doc.rect(x + padding, clientBoxY, width - 2 * padding, 12);
    doc.setFontSize(7);
    doc.text(`Cliente: ${data.customerName}`, x + padding + 2, clientBoxY + 8);
    

    // Valores
    const valuesY = clientBoxY + 18;
    doc.setFontSize(8);
    doc.setFont('helvetica', 'bold');
    doc.text(`Valor da parcela: ${formatCurrency(data.amount)}`, x + padding, valuesY);
    doc.text(`Total: ${formatCurrency(data.totalAmount)}`, x + width - 55, valuesY);
    doc.setFont('helvetica', 'normal');

    // ID
    const idY = valuesY + 6;
    doc.setFontSize(6);
    doc.text(`ID: ${uniqueId}`, x + padding, idY);

    // Linha de assinatura
    const signY = offsetY + height - 10;
    doc.setFontSize(6);
    doc.text(`Assinatura do ${assinatura}`, x + padding + 1, signY - 1);
    doc.line(x + padding, signY, x + width - padding, signY);

    doc.setFontSize(6);
    doc.text("Guarde este comprovante.", x + padding, offsetY + height - 3);
  };

  drawVia(y, "Via do Cliente", "Credor");

  doc.setLineDashPattern([2, 2], 0);
  doc.line(x, y + height + spacing / 2, x + width, y + height + spacing / 2);
  doc.setLineDashPattern([], 0);

  drawVia(y + height + spacing, "Via do Credor", "Cliente");

  return height * 2 + spacing;
}



}

